     */
    function punishmentNumber($n) {
        $sum = 0;
        for ($i = 1; $i <= $n; $i++) {
            $square = $i * $i;
            $strSquare = (string)$square;
            $len = strlen($strSquare);
            for ($j = 1; $j < $len; $j++) {
                for ($k = 0; $k + $j <= $len; $k++) {
                    $part1 = substr($strSquare, 0, $k);
                    $part2 = substr($strSquare, $k, $j);
                    $part3 = substr($strSquare, $k + $j);
                    $parts = [$part1, $part2, $part3];
                    $parts = array_filter($parts, function($value) { return $value !== ""; });
                    $partsSum = array_sum(array_map('intval', $parts));
